/**
 * Return either a `raw` node in dangerous mode, otherwise nothing.
 *
 * @type {Handler}
 * @param {HTML} node
 */
export function html(
  h: import('../index.js').H,
  node: HTML
):
  | import('../index.js').Content
  | import('../index.js').Content[]
  | null
  | undefined
export type HTML = import('mdast').HTML
export type Handler = import('../index.js').Handler
